import React from "react";
import { Nav, } from "react-bootstrap";
const Footer = () => {
  return (
    <footer>
      <div
        className="bg-dark text-white  p-30px 20px"
        style={{ fontSize: "2vw" }}
      >
        The Generics
      </div>
      <div>
        <Nav className="me-auto">
          <Nav.Link href='https://www.youtube.com'><i class="fa-brands fa-youtube" style={{color: "#e60f0f"}}></i></Nav.Link>
          <Nav.Link href="#features">Features</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link>
        </Nav>
      </div>
    </footer>
  );
};

export default Footer;
